const counts = {};

const userArray = [10,20, 10, 10, 20, 40, 80, 30];

userArray.forEach(function (x) { counts[x] = (counts[x] || 0) + 1; });

console.log(counts)

const Headings = () => {
  const headings = counts.map((number, index)=>
    <h1 key={index}>{number}</h1>)
  return <header>{headings}</header>
}



export default Headings;
